import React, { Component } from 'react'
import BuyForm from './BuyForm'

class Main extends Component {

    constructor(props) {
        super(props)
        this.state = {
            output: '0'
        }
    }
    render() {
        return (
        <div id="Content">
            <div className="card mb-4" >
            <div className="card-body">
                <BuyForm/>
            </div>
            </div>
        </div>
        );
    }
    }

export default Main;
